import { createRouter, createWebHistory } from 'vue-router';
import MainView from '../views/MainView.vue';
import Configuracion from '../views/Configuracion.vue';
import AgregarNegocio from '../views/AgregarNegocio.vue';
import Movimientos from '../views/Movimientos.vue';
import Productos from '../views/Productos.vue';
import Empleados from '../views/Empleados.vue';
import Clientes from '../views/Clientes.vue';
import Proveedores from '../views/Proveedores.vue';

const routes = [
    { path: '/', name: 'MainView', component: MainView },
    { path: '/Configuracion', name: 'Configuracion', component: Configuracion },
    { path: '/AgregarNegocio', name: 'AgregarNegocio', component: AgregarNegocio },
    { path: '/Movimientos', name: 'Movimientos', component: Movimientos },
    { path: '/Productos', name: 'Productos', component: Productos },
    { path: '/Empleados', name: 'Empleados', component: Empleados },
    { path: '/Clientes', name: 'Clientes', component: Clientes },
    { path: '/Proveedores', name: 'Proveedores', component: Proveedores }
  ];

  const router = createRouter({
    history: createWebHistory(process.env.BASE_URL),
    routes
  });



export default router;
